For each position, calculate the average conservation across selected phyla\n                for (let pos = 0; pos &lt; positions.length; pos++) {\n                    let valid_scores = 0;\n                    let sum = 0;\n                    \n                    for (let i of active) {\n                        const phylum = phyla[i];\n                        if (phylum in phylum_data) {\n                            sum += phylum_data[phylum][pos];\n                            valid_scores++;\n                        }\n                    }\n                    \n                    combined_scores[pos] = valid_scores &gt; 0 ? sum / valid_scores : 0;\n                }\n                \n                source.data['conservation'] = combined_scores;\n                source.data['phylum'] = positions.map(p =&gt; selected_phyla.join(', '));\n            }\n            \n            source.change.emit();\n        "}}]]]},"labels":["Ascomycota","Basidiomycota","Blastocladiomycota","Chytridiomycota","Cryptomycota","Mucoromycota","Zoopagomycota"],"active":[0,1,2,3,4,5,6]}}]}},{"type":"object","name":"Figure","id":"p1312","attributes":{"width":1200,"height":200,"x_range":{"type":"object","name":"Range1d","id":"p1322","attributes":{"end":1893}},"y_range":{"type":"object","name":"Range1d","id":"p1323","attributes":{"end":2}},"x_scale":{"type":"object","name":"LinearScale","id":"p1324"},"y_scale":{"type":"object","name":"LinearScale","id":"p1325"},"title":{"type":"object","name":"Title","id":"p1315","attributes":{"text":"Conservation scores for LYS2"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1361","attributes":{"data_source":{"id":"p1351"},"view":{"type":"object","name":"CDSView","id":"p1362","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p1363"}}},"glyph":{"type":"object","name":"Rect","id":"p1358","attributes":{"x":{"type":"field","field":"x"},"y":{"type":"field","field":"y"},"width":{"type":"value","value":1},"height":{"type":"va
